import React from "react";

export default function SunriseSunset(props) {
    return (
        <div id="weather-conditions">
            <ul>
              <li>
                <img
                  id="weather-conditions-icons"
                  src="images/HUMIDITY.png"
                  alt="humidity-icon"
                />
              </li>
              </ul>
              </div>
    )
}
